import React, { Component } from 'react';
import Header from '../header/header';
import LightVersion from '../Sidebar/Types/LightVersion';
import BusinessSidebar from './Types/LightVersion/BusinessSidebar'
import PersonalSidebar from './Types/LightVersion/PersonalSidebar'
import Avatar1 from '../../images/menu-icon/chat1.png'
import Avatar2 from '../../images/menu-icon/chat2.png'
import Avatar3 from '../../images/menu-icon/chat3.png'
import { grid } from 'react-icons-kit/feather/grid';
import {star} from 'react-icons-kit/feather/star'
import {user} from 'react-icons-kit/feather/user'
import {flash} from 'react-icons-kit/fa/flash'
import {ic_tune} from 'react-icons-kit/md/ic_tune'
import { Icon } from 'react-icons-kit'
import {folder} from 'react-icons-kit/feather/folder'
import {ic_help_outline} from 'react-icons-kit/md/ic_help_outline'
import './Sidebar.css'

class Index extends Component {
    constructor(props) {
        super(props)
        this.state = {
            header: [
                { title: 'Sidebars' }
            ],
            PersonalnavLinks: [
                {
                    id:'dashboard',
                    text: 'Dashboard',
                    // path: '/',
                    menuIcon: <Icon icon={grid}/>,
                    iconActive: true,
                    active: false,
                    items: [
                        {
                            id: '11',
                            text: 'item11',
                            active: true,
                        },
                        {
                            id: '12',
                            text: 'item12',
                            active: false,
                        },
                        {
                            id: '13',
                            text: 'item13',
                            active: false,
                        },
                    ],
                },
                {
                    id: 'people',
                    text: 'People',
                    // path: '/contact',
                    menuIcon: <Icon icon={user}/>,
                    iconActive: true,
                    active: false,
                    items: [
                        {
                            id: '21',
                            text: 'item11',
                            active: true,
                        },
                        {
                            id: '22',
                            text: 'item12',
                            active: false,
                        },
                        {
                            id: '23',
                            text: 'item13',
                            active: false,
                        },
                    ],
                },
                {
                    id: 'favourite',
                    text: 'Favourites',
                    // path: '/about',
                    menuIcon: <Icon icon={star}/>,
                    iconActive: true,
                    active: false,
                },
                {
                    id: 'updates',
                    text: 'Updates',
                    // path: '/blog',
                    BadgeActive: true,
                    badgeText: '+10',
                    badgeBg: 'red',
                    menuIcon: <Icon icon={flash}/>,
                    iconActive: true,
                    active: false,
                },
                {
                    id: 'setting',
                    text: 'Setting',
                    // path: '/portfolio',
                    menuIcon: <Icon icon={ic_tune}/>,
                    iconActive: true,
                    active: false,
                },
            ],
            PersonalotherLinks: [
                {
                    text: 'my collections',
                    items: [
                        {
                            id: '31',
                            text: 'Mood Inspiration',
                            menuIcon: <Icon icon={folder} style={{color: 'var(--primary-variant)'}}/>,
                            iconActive: true,
                            active: false,
                            items: [
                                {
                                    id: '41',
                                    text: 'Mood Inspirationdsfdsfsdf',
                                    menuIcon: <Icon icon={folder} style={{backgroundColor: 'red'}}/>,
                                    iconActive: true,
                                    active: false,
                                },
                                {
                                    id: '42',
                                    text: 'International Women’s Day — Editorial Selects',
                                    menuIcon: <Icon icon={folder} fill="red"/>,
                                    iconActive: true,
                                    active: false
                                },
                                {
                                    id: '43',
                                    text: 'Visual Assets for Marketers',
                                    menuIcon: <Icon icon={folder} fill="red"/>,
                                    iconActive: true,
                                    active: false
                                }
                            ]
                        },
                        {
                            id: '51',
                            text: 'International Women’s Day — Editorial Selects',
                            menuIcon: <Icon icon={folder} style={{color: 'var(--secondary)'}}/>,
                            iconActive: true,
                            active: false
                        },
                        {
                            id: '52',
                            text: 'Visual Assets for Marketers',
                            menuIcon: <Icon icon={folder} style={{color: 'var(--La-Rioja)'}}/>,
                            iconActive: true,
                            active: false
                        }
                    ]

                }
            ],
            PersonalbottomFixed: [
                {
                    text: 'Need Help?',
                    menuIcon: <Icon icon={ic_help_outline} fill="red" size={20} style={{backgroundColor: '#f2f2f2', width: '40px',height: '40px',borderRadius: '40px',display: 'flex',alignItems: 'center',justifyContent: 'center'}}/>,
                    iconActive: true,                  
                }
            ],
            BusinessnavLinks: [
                {
                    id:'Michael',
                    text: 'Michael',
                    // path: '/',
                    menuIcon: <Icon icon={grid}/>,
                    iconActive: true,
                    active: false,
                    items: [
                        {
                            id: '11',
                            text: 'item11',
                            active: true,
                        },
                        {
                            id: '12',
                            text: 'item12',
                            active: false,
                        },
                        {
                            id: '13',
                            text: 'item13',
                            active: false,
                        },
                    ],
                },
                {
                    id: 'My Music',
                    text: 'My Music',
                    // path: '/contact',
                    menuIcon: <Icon icon={user}/>,
                    iconActive: true,
                    active: false,
                    items: [
                        {
                            id: '21',
                            text: 'item11',
                            active: true,
                        },
                        {
                            id: '22',
                            text: 'item12',
                            active: false,
                        },
                        {
                            id: '23',
                            text: 'item13',
                            active: false,
                        },
                    ],
                },
                {
                    id: 'Collections',
                    text: 'Collections',
                    // path: '/about',
                    menuIcon: <Icon icon={star}/>,
                    iconActive: true,
                    active: false,
                },
                {
                    id: 'Pictures',
                    text: 'Pictures',
                    // path: '/blog',
                    BadgeActive: true,
                    badgeText: '+10',
                    badgeBg: 'red',
                    menuIcon: <Icon icon={flash}/>,
                    iconActive: true,
                    active: false,
                },
                {
                    id: 'Achievements',
                    text: 'Achievements',
                    // path: '/portfolio',
                    menuIcon: <Icon icon={ic_tune}/>,
                    iconActive: true,
                    active: false,
                },
            ],
            BusinessotherLinks: [
                {
                    text: 'Friends',
                    items: [
                        {
                            id: '31',
                            text: 'Mood Inspiration',
                            menuIcon: <img src={Avatar1} alt="avitar1"/>,
                            iconActive: true,
                            active: false,
                            items: [
                                {
                                    id: '41',
                                    text: 'Mood Inspirationdsfdsfsdf',
                                    menuIcon: <Icon icon={folder} style={{backgroundColor: 'red'}}/>,
                                    iconActive: true,
                                    active: false,
                                },
                                {
                                    id: '42',
                                    text: 'International Women’s Day — Editorial Selects',
                                    menuIcon: <Icon icon={folder} fill="red"/>,
                                    iconActive: true,
                                    active: false
                                },
                                {
                                    id: '43',
                                    text: 'Visual Assets for Marketers',
                                    menuIcon: <Icon icon={folder} fill="red"/>,
                                    iconActive: true,
                                    active: false
                                }
                            ]
                        },
                        {
                            id: '51',
                            text: 'International Women’s Day — Editorial Selects',
                            menuIcon: <img src={Avatar1} alt="avitar1"/>,
                            iconActive: true,
                            active: false
                        },
                        {
                            id: '52',
                            text: 'Visual Assets for Marketers',
                            menuIcon: <Icon icon={Avatar3}/>,
                            iconActive: true,
                            active: false
                        }
                    ]

                }
            ],
            BusinessbottomFixed: [
                {
                    text: 'Need Help?',
                    menuIcon: <Icon icon={ic_help_outline} fill="red" size={20} style={{backgroundColor: '#f2f2f2', width: '40px',height: '40px',borderRadius: '40px',display: 'flex',alignItems: 'center',justifyContent: 'center'}}/>,
                    iconActive: true,                  
                }
            ]
        }
    }
    render() {
        return (
            <div className="wrapper">
                <section className="container h-100">
                    <div className="row h-100">
                        <Header header={this.state.header[0].title} />  
                        <div className="row w-100 h-100">
                            <div className="col-md-12 mb-30 h-100">
                                <div className="h5 mb-20">Light Version</div>
                                <div className="row mb-50 h-75">
                                    {/* <div className="col-md-4">
                                        <LightVersion 
                                            BrandActive={false}
                                            navLinks={this.state.navLinks}
                                            otherLinks={this.state.otherLinks}
